import * as React from 'react';
import { LineChart } from '@mui/x-charts/LineChart';
import Typography from '@mui/material/Typography';
import { Container } from '@mui/material';

const uData = [4000, 3000, 2000, 2780, 1890, 2390, 3490];
const pData = [2400, 1398, 9800, 3908, 4800, 3800, 4300];
const xLabels = [
  'Mon',
  'Tue',
  'Wed',
  'Thu',
  'Fri',
  'Sat',
  'Sun',
];

export default function SimpleLineChart() {
  return (
    <Container>
      <Typography
        color='inherit'
        sx={{ fontSize: '30px', marginBottom: '20px' }}
      >
        Orders
      </Typography>
      <LineChart
        // width={1100}
        // height={400}  // Increased height for better visibility
        grid={{ vertical: false, horizontal: true }}  // Horizontal grid lines only
        xAxis={[{ scaleType: 'point', data: xLabels }]}
        series={[
          { data: pData, label: 'Product A' },
          { data: uData, label: 'Product B' },
        ]}
        margin={{ bottom: 50 }}  // Added margin to display labels properly
      />
    </Container>
  );
}
